import { StackNavigator } from "react-navigation";

import Home from "./screens/Home";
import Login from "./screens/Login";

export const SignedOut = StackNavigator({
  SignUp: {
    screen: Home,
    navigationOptions: {
      title: "Home"
    }
  },
  SignIn: {
    screen: Login,
    navigationOptions: {
      title: "Login"
    }
  }
});
